import React from 'react'
import './Button.css'

function Button({title, type, disabled, action}) {
    return (
        <div className="button">
            <button 
                className = {type} 
                disabled = {disabled}
                onClick = {action} 
            >
                {title}
            </button>
        </div>
    )
}

export default Button
